import React from "react";
import { NavLink } from "react-router-dom";

function SideBar(){

    return(
    <aside>
      <div>
      <div>
        <NavLink
        style={{color:"black",  textDecoration: "none"}}
        activestyle={{color:"#eb5149"}}
        to="/main">
          머니 충전
        </NavLink>
      </div>
      <div>
        <NavLink to="/main/payCash">
          머니 결제
        </NavLink>
      </div>
      <div>
        <NavLink to="/payHistory">
          거래내역
        </NavLink>
      </div>
      </div>
    </aside>
    )
}

export default SideBar;
